import React from 'react';
import "../../App.css";
import Header from '../header/Header';
import Footer from '../footer/Footer';
import ScrollUp from '../scrollup/ScrollUp';

const OnlineCourses = () => {
    return (
      <>
      <Header />
  
      <section className="onlinecourses section">
            <h2 className="page__title">Online Courses</h2>
            <span className="section__subtitle">An overview of the courses I am completing</span>

            <h2 className="section__title">Data Camp: Data Scientist with Python Career Track</h2>
      </section>
  
      <Footer />
      <ScrollUp />
      </>
    );
  };


export default OnlineCourses
